import React, { Component } from 'react';
import logo from './logo.svg';

import MapCard from "./Components/MapCard.jsx"
import NewsCard from "./Components/NewsCard.jsx"
import StatsCard from "./Components/StatsCard.jsx"
import Picker from './Components/Picker';

import './App.css';



class App extends Component {

  constructor(){
    super()
    this.state = {
      clientOptions: [1],
      defaultClientOption: 1,
      originOptions: ['AUH'],
      defaultOriginOption: 'AUH',
      destOptions: [],
      defaultDestOption: 'All',
      currentDestOption: 'All',
      weight_data: [], 
      figs: [],
      destLat: 999,
      destLon: 999,
      top5: [],
      currentRateOption: 1.65,
      rateOptions: [1.65, 1.7, 1.75, 1.8]
    }
  }

  render(){
    return (
      <div className="App">
        <Picker cid={'country-menu'} options={this.state.clientOptions} value={this.state.defaultClientOption} placeholder={this.state.defaultClientOption}/>
        <MapCard></MapCard>
        <NewsCard></NewsCard>
        <StatsCard></StatsCard>
      </div>
    );
  }
}

export default App;
